  calculateScore = () => {
    var qs = ["q2","q3","q4","q5","q6","q7","q8", "q10", "q11", "q12", "q13"]
    var i;
    var evens = 0;
    var odds = 0;
    var total = 0;
    var answers = this.state.questions;
    for(i=1; i<qs.length+1; i++){
      if(i%2===0){
        evens += this.convertAgreement(answers[qs[i]]);
      }else{
        odds += this.convertAgreement(answers[qs[i]]);
      }
    }
    total = 25-evens + odds-5
    total *= 2.5
    this.addState("Usability Score", total);
  }

  convertAgreement = (value) => {
    switch(value){
      case "Strongly Agree":
        return 5;
      case "Agree":
        return 4;
      case "Neither Agree nor Disagree":
        return 3;
      case "Disagree":
        return 2;
      case "Strongly Disagree":
        return 1;
    }
  }

